import React from 'react';
import '../style/button.css';

function Button({ btnName, btnType }) {
  const btnHeader = 'header-btn';

  if (btnType === btnHeader) {
    return (
      <button
        className="page-btn"
        type="button"
      >
        { btnName }
      </button>
    );
  }
  return (
    <button
      className="filter-btn"
      type="button"
    >
      { btnName }
    </button>
  );
}

export default Button;
